// src/pages/Skills/Skills.js
import React from 'react';
import { Box, Typography, Grid, LinearProgress } from '@mui/material';
import './Skills.css';

const skillsData = [
  {
    category: 'Frontend',
    skills: [
      { name: 'React.js', level: 90 },
      { name: 'JavaScript (ES6+)', level: 85 },
      { name: 'HTML5 & CSS3', level: 95 },
      { name: 'Material UI', level: 80 },
      { name: 'Bootstrap 5', level: 80 },
    ],
  },
  {
    category: 'Backend',
    skills: [
      { name: 'Node.js', level: 85 },
      { name: 'Express.js', level: 80 },
      { name: 'MongoDB', level: 75 },
      { name: 'REST API Design', level: 85 },
    ],
  },
  {
    category: 'Tools & Others',
    skills: [
      { name: 'Git & GitHub', level: 90 },
      { name: 'Docker', level: 70 },
      { name: 'Webpack', level: 65 },
      { name: 'Jest (Testing)', level: 60 },
    ],
  },
];

export default function Skills() {
  return (
    <Box className="skills-page">
      <Typography
        variant="h3"
        align="center"
        gutterBottom
        className="skills-title"
      >
        Skills
      </Typography>

      <Grid container spacing={4}>
        {skillsData.map((section) => (
          <Grid item xs={12} sm={6} md={4} key={section.category}>
            <Typography
              variant="h5"
              className="skills-category"
              gutterBottom
            >
              {section.category}
            </Typography>
            {section.skills.map((skill) => (
              <Box key={skill.name} className="skill-item">
                <Typography variant="body1" className="skill-name">
                  {skill.name}
                </Typography>
                <LinearProgress
                  variant="determinate"
                  value={skill.level}
                  className="skill-progress"
                />
                <Typography variant="body2" className="skill-level">
                  {skill.level}%
                </Typography>
              </Box>
            ))}
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}
